int main() {
  int s; cin >> s;
  unordered_set<int> se; // Use unordered set for faster lookup
  int current = s;
  int i = 1;

  // Single loop to generate sequence and check for repeats
  while (true) { 
    se.insert(current); // Insert the current into the set immediately
    current = (current % 2 == 0) ? current / 2 : 3 * current + 1;
    i++;
    if (se.find(current) != se.end()) { // Check if current already exists in the set
      cout << i << endl; // Print the current index and exit
      return 0;
    }
  }
}

