#include <bits/stdc++.h>

using namespace std;

class Range {
public:
    class Iterator {
    public:
        Iterator(int current) : current_value(current) {}
        int operator*() const { return current_value; }
        Iterator& operator++() { ++current_value; return *this; }
        bool operator!=(const Iterator& other) const { return current_value != other.current_value; }
    private:
        int current_value;
    };

    Range(int start, int end) : start_value(start), end_value(end) {}
    Iterator begin() const { return Iterator(start_value); }
    Iterator end() const { return Iterator(end_value); }
private:
    int start_value, end_value;
};

int main() {
    string s1, s2;
    cin >> s1 >> s2;
    int n = s1.size(), m = s2.size();

    vector<int> dp(m + 1);

    for (int i : Range(0, m + 1)) dp[i] = i;

    for (int i : Range(1, n + 1)) {
        int prev = i - 1; // Start with the previous row's factor for dp[i-1][0]
        dp[0] = i; // Initialize dp[i][0] since i-1 to i cost 1 step insertion
        for (int j : Range(1, m + 1)) {
            int temp = dp[j]; // Store current dp[i-1][j]
            if (s1[i - 1] != s2[j - 1])
                dp[j] = min({prev + 1, dp[j] + 1, dp[j - 1] + 1}); // Apply the dp formula
            else
                dp[j] = min({prev, dp[j] + 1, dp[j - 1] + 1}); // Apply the dp formula with no change
            prev = temp; // Move to the next state for dp[i-1][j-1]
        }
    }

    cout << dp[m] << endl;
    return 0;
}

